Hello,

I have two questions about: 1) MX symbol concatenation related to (#2498 #2504 #3170) and 2) conversion from MX symbol to SX symbol.

It looks like 1) is answered and described as solved in #2498 and #2504 by @jgillis but I do not understand how to get a symbolic class of MX variable concatenation. How can I obtain concatenation of the MX symbols (specifically Opti stack) in MATLAB as **_symbol class_**? I would like to use concatenated symbolic variables as inputs for CasADi Function, which requires symbolic class variables. One example is described in #3170 by @yakunouyang as follows:
```
import casadi.*

x = MX.sym('x', 2);
xx = x(1);
yy = x(2);
nlp = struct('x', [xx; yy], 'f', (xx-1)^2 + (yy+1)^2); % FAILED because of re-concatenation
nlp = struct('x', x, 'f', (xx-1)^2 + (yy+1)^2); % working example

solver = nlpsol('solver', 'ipopt', nlp);
tsol = solver('lbx', -10, 'ubx', 10, 'p', 2);
```

As a workaround, I am considering converting MX variables to SX variable, which increases computational load though. Does CasADi support converting from MX symbols to SX symbols?
